<article>
    <p>The major focus of the Ryten Laboratory is the use of transcriptomic data as a functional read-out of the genome and how that read-out can inform our understanding of biological processes to improve human health. We work in neurogenetics, one of the most challenging disease areas and use transcriptomic data, primarily derived from human brain or brain relevant cell types, to build the resources required to improve the molecular understanding of complex and rare neurological diseases with a particular focus on neurodegenerative diseases.</p>
    <p>We are highly collaborative and we are interested in making our work accessible and useful within the neuroscience research community, but also within clinical and diagnostic settings.  As part of UCL Queen Square Institute of Neurology (London) and in collaboration with the University of Murcia (Spain), our on-going work covers the genetic regulation of gene expression in human brain, gene co-expression networks, re-");
            WriteLiteral(@"annotation of genes associated with neurological diseases and the use of transcriptomics to improve diagnostic yield. We have released many of the outputs of these projects through the development of different web tools.</p>
